  render() {
    return (
      <div className={[style.msg, 'container'].join(' ')}>
        <div className='row'>
          <SummaryInfo />
          <button className={['btn', 'btn-danger', 'offset-sm-8'].join(' ')} style={{}}>删除</button>
        </div>
      </div>
    )
  }
}
